                        <p>Mentions légales</p>
                        <p>Confidentialité - RGPD</p>
                        <p>Gestion des cookies</p>
                    <h3>Reseaux sociaux</h3>
                        <p>linkedin</p>
                    <h3>Application</h3>
                        <p>Google Play</p>
                        <p>App store</p>
            </footer>
        </>
    );

}

export default Footer;
